import Layout from './components/MyLayout';
import BaoTuoiTre from './components/BaoTuoiTre';



const layoutStyle = {
  marginTop: 10,
  marginBottom: 20,
  padding: 20,
  border: '1px solid #DDD'
};


export default (props) => {
  // console.log(props)
  let key=0;
  return (
    <Layout content={
      <div style={layoutStyle}>
        <BaoTuoiTre />
      </div>
    }/>  
  )
}
